const gravitonElements=document.querySelectorAll(".graviton"),gravitonElementsHor=document.querySelectorAll(".graviton-hor");function calcGravity(){let a,e=window.scrollY;gravitonElements.forEach((r=>{if(Number(r.dataset.gravity))switch(parseInt(r.dataset.gravity,10)){case 1:a=.07;break;case 2:a=.1;break;case 3:a=.15;break;case 4:a=.17;break;case 5:a=.2;break;case 6:a=.25;break;case 7:a=.27;break;case 8:default:a=.3;break;case 9:a=.35;break;case 10:a=.37;break;case 1:a=-.07;break;case 2:a=-.1;break;case 3:a=-.15;break;case 4:a=-.17;break;case 5:a=-.2;break;case 6:a=-.25;break;case 7:a=-.27;break;case 8:a=-.3;break;case 9:a=-.35;break;case 10:a=-.37}else switch(r.dataset.gravity){case"Earth":a=9.802;break;case"Moon":a=1.62;break;case"Mars":a=3.71;break;case"Venus":a=8.87}let s=a*e;r.style.transform=`translateY(${s}px)`})),gravitonElementsHor.forEach((r=>{if(Number(r.dataset.gravity))switch(parseInt(r.dataset.gravity,10)){case 1:a=.07;break;case 2:a=.1;break;case 3:a=.15;break;case 4:a=.17;break;case 5:a=.2;break;case 6:a=.25;break;case 7:a=.27;break;case 8:default:a=.3;break;case 9:a=.35;break;case 10:a=.37;break;case 1:a=-.07;break;case 2:a=-.1;break;case 3:a=-.15;break;case 4:a=-.17;break;case 5:a=-.2;break;case 6:a=-.25;break;case 7:a=-.27;break;case 8:a=-.3;break;case 9:a=-.35;break;case 10:a=-.37}else switch(r.dataset.gravity){case"Earth":a=9.802;break;case"Moon":a=1.62;break;case"Mars":a=3.71;break;case"Venus":a=8.87}let s=a*e;r.style.transform=`translateX(${s}px)`})),requestAnimationFrame(calcGravity)}calcGravity();